	idx.AddKeyField(&types.BaseField{Id: 34052, Name: "Jobba hemmifrån", Description: "Baserat på PCMark 10 Office-testning. För att nå de högsta nivåerna behövs såväl lågt ljud som produktivitetsfunktioner vara närvarande.", Priority: 735.0})
	idx.AddKeyField(&types.BaseField{Id: 34053, Name: "Underhållning", Description: "Baserat på PCMark 10-testning. För att nå de högsta nivåerna måste en högkvalitativ panel för bärbara datorer/ allt-i-ett och låg ljudnivå under användning vara närvarande.", Priority: 735.0})
