	idx.AddKeyField(&types.BaseField{Id: 34055, Name: "Familjeanvändning", Description: "Baserat på resultat från andra tester såsom grundläggande spel, office och underhållning, för att visa enhetens mångsidighet.", Priority: 735.0})
	idx.AddKeyField(&types.BaseField{Id: 34056, Name: "Videoredigering", Description: "Baserat på Procyon-testing, minne och lagringskapacitet. För de högsta nivåerna krävs en stor färgskala för bärbara datorer.", Priority: 735.0})
	idx.AddKeyField(&types.BaseField{Id: 34057, Name: "Microsoft Office", Description: "Baserat enbart på PCMark Office-testning. På de högsta nivåerna kan du förvänta att enheten fortsätter med de snabbaste skrivningarna och de tyngsta presentationerna.", Priority: 735.0})
