	idx.AddKeyField(&types.BaseField{Id: 34060, Name: "Bärbarhet", Description: "Baserat enbart på enhetens funktioner, särskilt batteriets livslängd och vikt. För den högsta nivån krävs 10 timmars batteritid och mindre än 1,3 kg vikt.", Priority: 735.0})
	idx.AddKeyField(&types.BaseField{Id: 34061, Name: "Temperatur (tomgång)", Description: "Baserat på enhetens temperatur vid tomgång, uppmätt på flera ställen på den bärbara datorn. Högre nivå betyder lägre temperatur.", Priority: 735.0})
